HomeStyler:美家达人室内设计模拟平台是一个在线室内设计家居装修软件网络版工具，由美国欧特克公司开发;用户可以在线创建和共享家居设计方案，打造你的梦想之家，支持在线创建户型图，添加家居产品等各种功能。

美家达人的特点：
1、拖放房间、门和家具，快速创建户型图;
2、轻松试验不同的风格、色彩和装饰材料;
3、大量的家居产品库;
4、轻松一点，即可以三维方式呈现您的家居设计;
5、把您的设计分享给家人、朋友和专家以供点评;
6、使您在设计和选择产品时充满信心。

美家达人是欧特克为中国家装消费者最新提供的一个家装设计平台，它提供了一套免费的绿色在线设计软件，帮助用户在装修伊始可以自己规划房间布局，风格搭配，并可以迅速通过免费的3D效果图和 照片级效果图来感受整体的设计。 另外美家达人在线丰富的图库可以让用户可以浏览到来自世界各地的设计创意，以激发用户的家装灵感。
